import React from 'react';
import Header from './Header';
import Main from './Main';
import Footer from './Footer';

function App() {
  return (
    <>
      <div className="page__container">
        <Header />
        <Main />
        <Footer />


      </div>
      <template id="element-template" />
    </>
  );
}

export default App;
